style.css:
/* Custom YouTube Styles */
body {
    background-color: #f0f0f0; /* according to the picture provided */
    font-family: Arial, sans-serif; /* normal */
}

h1 {
    color: #ff0000; /* black */
    font-size: 24px; /* 14 */
}

p {
    color: #333; /* black */
    line-height: 1.5; /* normal */
}

/* Giao diện video nhúng */
iframe {
    border: none; /* none */
    width: 100%; /* 100% */
    height: 400px; /* 400px */
}
